INSERT INTO `p_fm_dynamicpage` VALUES ('1', '23', null, 'API管理列表', null, '1003', '0', null, null, null, null, null, '[{&quot;id&quot;:&quot;28e59625-77ac-23fa-a4da-6c647fd8f994&quot;,&quot;name&quot;:&quot;p_fm_api&quot;,&quot;isSingle&quot;:&quot;1&quot;,&quot;isPage&quot;:&quot;1&quot;,&quot;limitCount&quot;:&quot;20&quot;,&quot;description&quot;:&quot;&quot;,&quot;sqlScript&quot;:&quot;var name=request.getParameter(\\&quot;name\\&quot;);\\r\\nvar desc=request.getParameter(\\&quot;desc\\&quot;);\\r\\nvar id=request.getParameter(\\&quot;id\\&quot;);\\r\\nvar where =\\&quot;\\&quot;;\\r\\nif(name!=null &amp;&amp; name!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_NAME LIKE \'%\\&quot;+name+\\&quot;%\'\\&quot;;\\r\\n}\\r\\nif(desc!=null &amp;&amp; desc!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_DESC LIKE \'%\\&quot;+desc+\\&quot;%\'\\&quot;;\\r\\n}\\r\\n\\&quot;SELECT a.API_ID AS IDS, a.API_SQL,a.API_DESC,a.API_METHOD,case a.API_IS_LOGIN when \'1\' then \'需登录\' else \'不需登录\' end API_IS_LOGIN ,case a.API_STATE when \'0\' then \'禁用\' else \'启用\' end API_STATE,a.API_NAME,a.API_ID as ID,a.API_TABLE,case a.API_TYPE when \'0\' then \'forbidden\' when \'1\' then \'add\' when \'2\' then \'update\' when \'3\' then \'get\' when \'4\' then \'delete\' when \'5\' then \'excute\' when \'6\' then \'query\' when \'7\' then \'page\' when \'8\' then \'executeScript\' end API_TYPE FROM  p_fm_api a where 1=1 \\&quot; +where +\\&quot; order by a.API_CREATETIME desc \\&quot;;\\r\\n&quot;,&quot;deleteSql&quot;:&quot;&quot;,&quot;modelCode&quot;:&quot;p_fm_api&quot;,&quot;modelItemCodes&quot;:&quot;API_SQL,API_METHOD,API_TYPE,API_IS_LOGIN,API_ID,API_STATE,API_TABLE,API_DESC,API_NAME&quot;}]', '0', null, '$(&quot;.table tbody tr&quot;).each(function(i,e){\r\n	var id=$(this).children(&quot;td&quot;).eq(0).find(&quot;input&quot;).val();\r\n	var seq=$(this).children(&quot;td&quot;).eq(2)\r\n	seq.html(&quot;&lt;a href=\'&quot;+baseUrl+&quot;document/view.do?dynamicPageId=2&amp;i