c3-bf87-4861-a9b7-88b605f1a2e3\").val();\r\nif(id==null || id==\"\" || reader==1){\r\n$(\"#tb_8555626c-6361-4380-ab2a-4084596937ed\").hide();\r\n}\r\n$(\"textarea\").each(function(){\r\n$(this).css({\'height\':\'auto\',\'overflow-y\':\'hidden\'}).height(this.scrollHeight)\r\n})\r\n			\r\n			\r\n	$(\"#5d41e4d1-7bba-487b-9f98-b9e19172c2a6\").click(function(){\r\n			if(!Comm.validForm())\r\n				return;\r\n				var actId = $(this).attr(\"id\");\r\n$(\"#actId\").val(actId);\r\n	$.ajax({\r\n	   type: \"POST\",\r\n	   url: basePath + \"document/excuteOnly.do\",\r\n	   data:$(\"#groupForm\").serialize(),\r\n	   success: function(data){\r\n			if(data!=\"0\"){\r\n				Comm.alert(\"保存成功\",function(){\r\n					location.href= basePath + \"document/view.do?dynamicPageId=2&id=\"+data;\r\n				});\r\n				\r\n			}else{\r\n				Comm.alert(\"保存失败\");\r\n			}\r\n	   }\r\n	});\r\n	});\r\n	$(\"#0e68706c-4700-4767-ad34-41a17b9ee052\").click(function(){\r\n				location.href= basePath + \"document/view.do?dynamicPageId=1\";\r\n	});\r\n			\r\n	</script>\r\n</body>\r\n</html>', '2', '110', null, null, null, null, null, null, '1', '9999', '9999', '9999', '0', '0', null, '0', null, '0', '1');
