INSERT INTO `p_fm_dynamicpage` VALUES ('7', '23', null, '已绑定API列表', null, '1003', '0', null, null, null, null, null, '[{&quot;id&quot;:&quot;0db0d488-e514-ac6d-de1d-83d59a35d2f6&quot;,&quot;name&quot;:&quot;p_fm_api&quot;,&quot;isSingle&quot;:&quot;1&quot;,&quot;isPage&quot;:&quot;1&quot;,&quot;limitCount&quot;:&quot;0&quot;,&quot;description&quot;:&quot;&quot;,&quot;sqlScript&quot;:&quot;var pid=request.getParameter(\\&quot;pid\\&quot;);\\r\\nvar name=request.getParameter(\\&quot;name\\&quot;);\\r\\nvar desc=request.getParameter(\\&quot;desc\\&quot;);\\r\\nvar id=request.getParameter(\\&quot;id\\&quot;);\\r\\nvar where =\\&quot;\\&quot;;\\r\\nif(name!=null &amp;&amp; name!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_NAME LIKE \'%\\&quot;+name+\\&quot;%\'\\&quot;;\\r\\n}\\r\\nif(desc!=null &amp;&amp; desc!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_DESC LIKE \'%\\&quot;+desc+\\&quot;%\'\\&quot;;\\r\\n}\\r\\nif(id!=null &amp;&amp; id!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_ID LIKE \'%\\&quot;+id+\\&quot;%\'\\&quot;;\\r\\n}\\r\\n\\&quot;SELECT a.API_ID AS IDS, a.API_SQL,a.API_DESC,a.API_METHOD,case a.API_IS_LOGIN when \'1\' then \'需登录\' else \'不需登录\' end API_IS_LOGIN ,case a.API_STATE when \'0\' then \'禁用\' else \'启用\' end API_STATE,a.API_NAME,a.API_ID as ID,a.API_TABLE,case a.API_TYPE when \'0\' then \'forbidden\' when \'1\' then \'add\' when \'2\' then \'update\' when \'3\' then \'get\' when \'4\' then \'delete\' when \'5\' then \'excute\' when \'6\' then \'query\' when \'7\' then \'page\' when \'8\' then \'executeScript\' end API_TYPE FROM  p_fm_api a left join p_fm_api_privilege_relation b on a.API_ID=b.API_ID  where b.PRI_ID=\'\\&quot;+pid+\\&quot;\' \\&quot;+where+\\&quot; order by a.API_CREATETIME DESC\\&quot;;&quot;,&quot;deleteSql&quot;:&quot;&quot;,&quot;modelCode&quot;:&quot;p_fm_api&quot;,&quot;modelItemCodes&quot;:&quot;API_SQL,API_METHOD,API_TYPE,API_IS_LOGIN,API_REMARK,API_CREATETIME,API_ID,API_OUTPUT,API_CREATOR,API_STATE,